import React from "react";
import { Link } from "react-router-dom";
const Navbar = () => {
    return (
        <>
        <Link>About us</Link>
        <Link>Contact us</Link>
        <a href="/">About us</a>
        <a href="/contact">Contact us</a>
        </>
    );
};
export default Navbar;
